CREATE DEFINER=`root`@`localhost` PROCEDURE `3.i.top_5_products_in_a_state_each_year` (IN `state1` VARCHAR(30))  NO SQL
    DETERMINISTIC
SELECT * 
FROM
(SELECT *, RANK()
OVER (PARTITION BY S.year ORDER BY totalprofit DESC) AS Rank
FROM (SELECT P.productname AS prod, YEAR(O.orderdate) AS year, SUM(OL.profit) AS totalprofit
	FROM orderline AS OL
	JOIN product AS P
	ON OL.ProductID = P.ProductID
	JOIN orders AS O
	ON O.OrderID = OL.OrderID
	JOIN City AS Ci
	ON Ci.CityID = O.CityID
	JOIN State AS S
	ON S.StateID = Ci.StateID
	WHERE S.State = state1
	GROUP BY P.ProductName, YEAR(O.orderdate)
      ) AS S
 ) AS S1
 WHERE Rank < 6$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `3.ii._most_popular_product_in_cat_in_year` (IN `ProdCat1` VARCHAR(30), IN `year1` INT)  NO SQL
    DETERMINISTIC
SELECT P.productname AS prod, SUM(OL.Qty) AS totalsold
FROM orderline AS OL
JOIN product AS P
ON P.ProductID = OL.ProductID
JOIN ProductSubcategory AS PS
ON PS.ProductSubcategoryID = P.ProductSubcategoryID
JOIN ProductCategory AS PC
ON PC.ProductCategoryID = PS.ProductCategoryID
JOIN orders AS O
ON O.OrderID = OL.OrderID
WHERE PC.ProductCategory = ProdCat1 
AND YEAR(O.OrderDate) = year1
GROUP BY P.ProductName
ORDER BY totalsold DESC
LIMIT 1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `3.v.returning_manufacturer_revenue_per_year_and_segment` (IN `manufacturer1` VARCHAR(30))  NO SQL
SELECT YEAR(O.OrderDate), CS.CustomerSegment, SUM(OL.Sale)
FROM orderline as OL
JOIN orders AS O
ON OL.OrderID = O.OrderID
JOIN customer AS C
ON C.CustomerID = O.CustomerID
JOIN customersegment AS CS
ON CS.CustomerSegmentID = C.CustomerSegmentID
JOIN product AS P
ON P.ProductID = OL.ProductID
JOIN manufacturer AS M
ON M.ManufacturerID = P.ManufacturerID
WHERE M.Manufacturer = manufacturer1
GROUP BY YEAR(O.OrderDate), CS.CustomerSegment$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Get_Customer_Average` (IN `custID1` INT)  NO SQL
    DETERMINISTIC
SELECT @avgordercust:=
(SELECT AVG(ordertotal)
 FROM
 	(SELECT O.OrderID, SUM(OL.sale) AS ordertotal
     FROM orders AS O
     JOIN orderline AS OL
     ON O.OrderID = OL.OrderID
     JOIN customer AS C
     ON C.CustomerID = O.OrderID
     WHERE C.CustomerID = custID1
     GROUP BY O.OrderID) AS S1
)$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Get_Customer_Level` (IN `custID1` INT)  BEGIN 

SET @avgorderall:= 
(SELECT AVG(ordertotal)
 FROM
 	(SELECT O.OrderID, SUM(OL.sale) AS ordertotal
     FROM orders AS O
     JOIN orderline AS OL
     ON O.OrderID = OL.OrderID
     GROUP BY O.OrderID) AS S1
);

SET @avgordercust:=
(SELECT AVG(ordertotal)
 FROM
 	(SELECT O.OrderID, SUM(OL.sale) AS ordertotal
     FROM orders AS O
     JOIN orderline AS OL
     ON O.OrderID = OL.OrderID
     JOIN customer AS C
     ON C.CustomerID = O.OrderID
     WHERE C.CustomerID = custID1
     GROUP BY O.OrderID) AS S1
);

SELECT CASE 
WHEN @avgordercust > 2 * @avgorderall THEN "Key account"
WHEN @avgordercust > @avgorderall THEN "Platinum"
ELSE "Normal"
END;

END$$

